'use strict';

// MODULES //

var data = require( './data.js' );


// IMAGE //

/**
* Returns an image of boats in a river in Nagasaki.
*
* @returns {Buffer} image
*
* @example
* var img = image();
* // returns <Buffer>
*/
function image() {
	return new Buffer( data, 'base64' );
} // end FUNCTION image()


// EXPORTS //

module.exports = image;
